import {Component} from "@angular/core";

@Component({
  selector: 'app-server',
  templateUrl: './server.component.html'
})
export class ServerComponent{
  serverId: number = 10;
  serverStatus: string = '在线';

}
<h3>这个是一个server的HTML页面</h3>

<p>服务器的ID是{{ serverId }}，当前服务器的状态是{{ serverStatus }}</p>
